import classes from './Input.module.css'

const Input = (props) => {
    return <div className={props.className}>
    <label htmlFor={props.id}>{props.label}</label>
    <input
        id={props.id}
        type={props.type}
        value={props.value}
        onChange={props.onChange}
        onBlur={props.onBlur}
    />
  </div>
}

export default Input;
